import { useEffect, useState } from 'react'

export default function UseBookSearch(query, pageNumber) {
  useEffect(() => {
    axios({
        method: 'GET',
        url: 'http://openlibrary.org/search.json',
        oarams: {q: query, page: pageNumber}

    }).then(res => {
        console.log(res.data)
    })
  }, [query, pageNumber])
  return null
}
